import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Go to search view
    await page.click('.nav-item[data-view="search"]');
    await page.waitForSelector('#search-view');

    // Take screenshot after navigating to search view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_view.png'));

    // Type 'jun' in search input
    await page.fill('#search-input', 'jun');
    await page.waitForTimeout(500); // Wait for any potential dynamic content loading

    // Take screenshot after typing in search input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_typing_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_typing_search.png'));

    // Switch to People tab
    await page.click('.tab-btn[data-tab="people"]');
    await page.waitForSelector('.tab-btn.active[data-tab="people"]');

    // Take screenshot after switching to People tab
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_people_tab.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_people_tab.png'));

    return {
      success: true,
      action: "Navigated to search view, typed 'jun' in search input, and switched to People tab",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

